import Image from './assets/LinkedIn.png';
import Image1 from './assets/GitHub.png';
import CSPPTLogo from './assets/csppt_logo.png'
import LancasterLogo from './assets/Lancaster.png';
import More from './assets/More.png'
function TaskBar() {
    return (
        <div className='TaskBar'>
            <div className='Tasks'>
                <img src={Image} alt="LinkedIn Logo"></img>
                <img src={Image1} alt="GitHub Logo"></img>
                <img src={CSPPTLogo} alt="CSPPT Logo"></img>
                <img src={LancasterLogo} alt="lancaster Univeresity Logo"></img>
            </div>
            <img src={More} alt="Lancaster University Logo" className='Bottom'></img>
        </div>
    );
  }

  export default TaskBar;
